import React from 'react';

const ToDoList = (props) =>{

    const deleted = (id) => {
        console.log("deleted");
    }
    
    return(
        <>
           <div>
           <i
              onClick={() => {
                  props.onselect(props.id);
              }}
           ></i>
           <li>
                <button className="Delete" onClick={deleted}></button>            
           </li>
           </div>
        </>
    );
};

export default ToDoList;


